import React from "react";
import { Routes, BrowserRouter } from "react-router-dom";
import Index from "../pages";

const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Routes exact path="/" element={<Index />} />
      </Routes>
    </BrowserRouter>
  );
};

export default Router;
